import React from "react";

export const PorcoRossoAviaoSVG = () => {
  return (

    <svg width="356" height="282" viewBox="0 0 356 282" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
<ellipse cx="178" cy="141" rx="178" ry="141" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlinkHref="#image0_1_17" transform="matrix(0.00142727 0 0 0.0018018 -0.230762 0)"/>
</pattern>
<image id="image0_1_17" width="1024" height="555" xlinkHref="data:image/png;base64,"/>
</defs>
</svg>

  );
};
